text:
@eunseo5683 안녕하세요 쿠팡입니다.
문의하신 내용의 확인/처리를 위해서는 가입축하 메일을 받으신 고객님의 메일 주소가 확인이 되어야하오니,
쿠팡 고객센터(1577-7011)로 문의주시면 고객님 불편을 빠르게 도와드리도록 하겠습니다. 감사합니다

@ssyangnim 안녕하세요. 
말씀해 주신 사안에 대하여 정확히 확인하여 적절한 조치를 취하겠습니다.
제보에 감사드립니다.

@mav0074 안녕하세요. 쿠팡입니다.
이 이미지상의 내용은 사실이 아닌 조작된 이미지입니다.
고객분들께 오해를 불러일으킬수 있으니 정중히 삭제를 부탁드립니다.

@SAYUNGNA 안녕하세요. 고객님. 쿠팡입니다.
고객님의 트윗을 보고 배송지연등으로 불편을 겪으실까봐 찾아왔습니다. 쿠팡 고객센터(1577-7011) 혹은 1대1게시판으로 문의주시면
빨리 확인해드리도록 하겠습니다.감사합니다.

안녕하세요. 쿠팡입니다.
이용에 불편을 드려 죄송합니다. 잠시 네트워크 장애가 있었으나 현재 정상이용 가능합니다. 쿠팡 이용에 감사드립니다.

@rracneicul @shfwk1 @too_much_purple

@K_jineey 안녕하세요. 쿠팡입니다. 배송관련 불편을 겪으시는 것 같아 글을 남깁니다.
혹여 쿠팡서비스에 대한 문제가 있으시다면 쿠팡고객센터(1577-7011)로 연락주시거나 구매 주문번호등을 알려주시면 빠르게 도움을 
드릴수 있도록 하겠습니다.

@__Xoxio 혹시 2.12 이전 구매한 상품이 지연되고 있다면, 쿠팡 고객센터(1577-7011)로 문의주시거나 구매한 주문번호를 멘션등으로 알려주시면
빠르게 확인을 해드리도록 하겠습니다.
감사합니다.

@__Xoxio 안녕하세요. 고객님 쿠팡입니다.
배송지연으로 불편을 겪으시는 것 같아 찾아왔습니다.
판매시 공지된 것과 같이 설연휴로 2월12일 이후 구매한 상품은 2월 24일이후 배송이 시작되기에 아직 제품을 받지 못할 수 있습니다.

@Dinggul_NM 안녕하세요 고객님. 쿠팡입니다.
배송관련 일정에 대하여 안내를 드려야할 것 같아 찾아왔습니다.
구매당시 고지된 것 처럼 설연휴기간 구매한 상품들은 연휴기간 휴무로 인하여 출고 및 배송은 2.23(월)일부터 순차적으로 이루어집니다.

@45289957 안녕하세요. 고객님 쿠팡입니다. 
택배사의 배송지연으로 큰 불편을 겪으신 것 같아 사과의 말씀을 먼저 드립니다.
주문번호나 구매아이디를 맨션으로 알려주시면 빠른 확인을 해보도록 하겠습니다.

@dpftjdwhd 안녕하세요. 고객님. 쿠팡입니다.
고객님의 불편을 빨리 해결해드려야할 것 같아 찾아왔습니다. 
주문번호나 구매아이디를 알려주신다면빨리 확인해보도록 하겠습니다

@chohong_0305 안녕하세요. 쿠팡입니다. 
교환과정정 불편을 겪으시는 것 같아 찾아왔습니다.
구매아이디나 주문번호를 알려주시면 빠르게 도움드릴 수 있도록 하겠습니다.

@shyshy2101 안녕하세요. 쿠팡입니다.
쿠팡에서 구입한 이어폰과 관련한 불편을 겪으시는 것 같아 찾아왔습니다.
제품이 불량인 경우 교환반품이 가능하니 고객센터(1577-7011)로 문의주시거나

@WITH_M_ 자세한 내용은 고객센터 http://t.co/csaP39i0WY  에서 확인해보실 수 있어요
환불기간이 지났는데도 환불처리가 되고 있지않다면 쿠팡 트위터로 연락해주시기 바래요~ 
그럼 오늘도 기분 좋은 하루 보내세요 ^.~

@honjabob 배송 상품이 발송되면 택배사명과 송장번호를 바로 문자로 전송해드리고 있어요:)
[쿠팡] OO상품을 발송 준비중입니다
[쿠팡] 00상품이 00택배사 00(송장번호)로 발송 되었습니다.

@bittersweet9_jh @ssonic_ 
인트로 이미지 처리는 월요일 담당자가 즉시 처리키로 했습니다. 보다 빠른 처리를 강구하겠습니다.
이번 일로 비터스윗나인이란 멋진 초콜릿 가게를 알게되어 오히려 기쁘기도 합니다.저도 한번 꼭 들르겠습니다.

@bittersweet9_jh @ssonic_ 
보다 신속히 처리해드려야 하는데 주말 야간이라 물리적인 시간이 다소 소요된 점 오히려 송구합니다.

일단 판매중단 조치 및 블라인드 처리로 카테고리 게재 및 검색에도 제외시켰습니다.

@ssonic_ @bittersweet9_jh 
해당 티셔츠는 판매중단 조치했습니다. 추가조치시 차후 안내하여 드리겠습니다.
다시 한번 제보에 감사드립니다.

@ssonic_ @bittersweet9_jh 안녕하세요.
말씀해 주신 사안에 대하여 정확히 확인하여 적절한 조치를 취하겠습니다.
제보에 감사드립니다.

@erun1231 멋진 캐릭터 그려주셔서 되려 감사합니다^_^
혹시 어떤 계기로 쿠팡 그림을 그리게 되셨는지 여쭤보아도 될까요?
쿠팡에 특별한 애정이 있으신 것인지요~

@ggu_ung 고객님의 답변을 무시하려고 한 것은 아니니 오해 없으셨으면 합니다. 
고객센터 통해서 고객님의 불편사항을 파악한 후 다시 멘션 드리려 했는데,
ggu_ung님께서 기다리고 계신다는 것을 배려하지 못했네요.

@creamsauce_  1. 상품 파손으로 반품을 원하실 경우
   ① [마이쿠팡 &gt; 구매내역]에서 [반품신청] 버튼을 클릭
   ② 반품 사유 및 상품 수거 여부를 선택 후 [반품 신청하기]를 클릭
